    Head(HeadCategory category, String defaultName, String id) {
        this.name = defaultName;
        this.category = category;
        this.headLink = new me.tigahz.headlibrary.heads.Head(category.toString(), this.name, id).getLink();
        this.builder = new HeadBuilder().setName(this.name).setSkin(headLink);
    }

    private final HeadBuilder builder;
    private final String headLink;
    private final String name;
    private final HeadCategory category;

    public String headLink() {
        return this.headLink;
    }

    public String headName() {
        return this.name;
    }

    public HeadCategory category() {
        return this.category;
    }

    public ItemStack getHead() {
        return builder.build();
    }
